import React from 'react';

export default class DataList extends React.Component {
    constructor(props) {
        super(props);
    }

    render(){
        return (
            <div id={this.props.data.id}>
                <li>
                    <div>{this.props.data.city}</div>
                    <div>{this.props.data.company}</div>
                    <div>{this.props.data.email}</div>
                    <div>{this.props.data.firstName}</div>
                    <div>{this.props.data.grades}</div>
                    <div>{this.props.data.id}</div>
                    <div>{this.props.data.lastName}</div>
                    <img src={this.props.data.pic} />
                    <div>{this.props.data.skill}</div>
                </li>
            </div>
        )
    }
}
